function setup() {
    createCanvas(600, 500);
    background(200);
}

function draw() {
    stroke(100);
    strokeWeight(2);
    line(0,250,600,250);
    line(300, 0, 300, 500);
    line(0, 0,600,500 );
    line(600,0,0,500)

    fill(255, 0, 0);
    ellipse(300, 250, 100, 100);

    stroke(255);
    strokeWeight(4);
    stroke(21)
    line(185,175,30,175)
    line(30,175,30,30)
    line(185,30,185,175)
    line(30,30,185,30)

}


